const styleForm = {
    paper: {
        padding: 40,
        marginTop: 20,
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
    },
    Avatar: {
        matrgin: 8,
        backgroundColor: "#f50057"
    },
    formulario: {
        width: "70%",
        padding: 20,
        marginTop: 10
    },
    submit: {
        marginTop: 20,
        marginBottom: 15
    },
    fondo:{
        backgroundImage: 'url("https://github.com/JairPrada/Construccion/blob/master/views/public/imagenes/pd.jpg?raw=true")',
        backgroundRepeat: 'no-repeat',
        backgroundSize: 'cover'
    }
}
export default styleForm
